import lang from '../json_lib/language.json'
function WelcomePage(){
    console.log(lang)
    var search_recommend = function(e,a){
        console.log(e.nativeEvent.data,a)
    } 
    return (
        <div>
            안녕안녕
            <form >
                <input onChange={search_recommend}></input>
            </form>
        </div>
    )
}
export default WelcomePage;
